clear;
ValidationData = load("Data/M2M3ID_Test6_both_compensated.mat"); %[output:7c0ec4fc]
ValidationData = ValidationData.data;
% note that while this set includes compensation in the dataset, this was
% removed (by going a step back to current and repeating jacobian calcs) to
% ensure fair comparison
%%
% Search for testing times via force plate z readings:
FPz = ValidationData{3}.Values;

Start_times = [];
End_times = [];
valid = false;
for i =1:length(FPz.Data)
    if valid
        if FPz.Data(i)>-5
            End_times = [End_times, FPz.Time(i)-2]; % Chop off the robot being picked up
            valid = false;
        end    
    else
        if FPz.Data(i)<-30
            Start_times = [Start_times, FPz.Time(i)+2];% Chop off the robot being put down
            valid = true;
        end
    end
end
% End_times(5) = End_times(5); % Strange artifact at the end of final sample - something went wring with lifting off the force plate.

%%
% Torques calculated via force plate forces using the jacobian, 
FPy = [];
FPz = [];
MRq = [];
MLq = [];
MRt_read = [];
MLt_read = [];
MRt_cmd = [];
MLt_cmd = [];
ts = 1000;
Start_times =int32(Start_times*ts);
End_times = int32(End_times*ts);



% Resamples
MR_q_resample = resample(ValidationData{5}.Values.q, ValidationData{1}.Values.Time);
ML_q_resample = resample(ValidationData{6}.Values.q, ValidationData{1}.Values.Time);
MR_t_resample = resample(ValidationData{5}.Values.t, ValidationData{1}.Values.Time);
ML_t_resample = resample(ValidationData{6}.Values.t, ValidationData{1}.Values.Time);
MR_t_cmd_resample = resample(ValidationData{9}.Values.tff, ValidationData{1}.Values.Time);
ML_t_cmd_resample = resample(ValidationData{8}.Values.tff, ValidationData{1}.Values.Time);
for i = 1:length(Start_times)
    % Force plate
    FPy = [FPy; ValidationData{2}.Values.Data(Start_times(i): End_times(i))];
    FPz = [FPz; ValidationData{3}.Values.Data(Start_times(i): End_times(i))];
    % Motor angles
    
    MRq = [MRq; MR_q_resample.Data(Start_times(i): End_times(i))];
    MLq = [MLq; ML_q_resample.Data(Start_times(i): End_times(i))];

    % Motor torques (cmd)
    
    MRt_cmd = [MRt_cmd; MR_t_cmd_resample.Data(Start_times(i): End_times(i))]; 
    MLt_cmd = [MLt_cmd; ML_t_cmd_resample.Data(Start_times(i): End_times(i))];
    
    % Motor torques (read)
   
    MRt_read = [MRt_read; MR_t_resample.Data(Start_times(i): End_times(i))];
    MLt_read = [MLt_read; ML_t_resample.Data(Start_times(i): End_times(i))];

end
clear MR_q_resample ML_q_resample MR_t_resample ML_t_resample MR_t_cmd_resample ML_t_cmd_resample
%%
%[text] ## Transfer force plate data into torques
% From the side of forces:
Fy_cmd = [];
Fz_cmd = [];
Fy_read = [];
Fz_read = [];
FP_tl = [];
FP_tr = [];
VL_Fz_cmd = [];
[J11, J12, J21, J22] = BalekaJacobianXY(MLq, MRq);
for i = 1:length(MLt_cmd)
    Jxy = [J11(i), J12(i); J21(i), J22(i)];
    JTxy = Jxy';

    FP_t = JTxy*[FPy(i); FPz(i)];
    FP_tl = [FP_tl, FP_t(1)];
    FP_tr = [FP_tr, FP_t(2)];
    % 
    F_cmd = JTxy\[MLt_cmd(i); MRt_cmd(i)];
    Fy_cmd = [Fy_cmd; -F_cmd(1)];
    Fz_cmd = [Fz_cmd; -F_cmd(2)];

    F_read = JTxy\[MLt_read(i)*9*0.198; MRt_read(i)*9*0.198];
    Fy_read = [Fy_read; F_read(1)];
    Fz_read = [Fz_read; F_read(2)];
end
clear F_cmd F_read i J11 J12 J22 J21 times ts JTxy Jxy
%%
my_tune = 0.6540 %[output:0f5d1160]
cy_tune = -14.0836 %[output:9ede34eb]
mx_tune = 0.4951 %[output:4cd0f79c]
cx_tune = 1.5691 %[output:86527335]

Fz_read_comp = my_tune*Fz_read +cy_tune;
Fy_read_comp = mx_tune*Fy_read + cx_tune;


MSE_F_hor_ReadM2M3_uncompensated =  mean((Fy_read - FPy).^2) %[output:330f05e2]
MSE_F_vert_ReadM2M3_uncompensated =  mean((Fz_read - FPz).^2) %[output:02165a9f]


MSE_F_hor_ReadM2M3_compensated =  mean((Fy_read_comp - FPy).^2) %[output:47aec63e]
MSE_F_vert_ReadM2M3_compensated =  mean((Fz_read_comp - FPz).^2) %[output:7a2b66e5]
% forces:
plot(FPz) %[output:713d83c5]
hold on %[output:713d83c5]
% plot(Fz_cmd)
plot(Fz_read) %[output:713d83c5]
plot(Fz_read_comp) %[output:713d83c5]
legend('Force plate Fz', 'Motor read Fz', 'Compensated Motor read Fz'); %[output:713d83c5]
title('Vertical force plate vs read') %[output:713d83c5]
hold off %[output:713d83c5]

% percentErrorFz = mean(abs((Fz_read - FPz)./FPz)*100)
% 
% percentErrorFzComp = mean(abs((Fz_read_comp - FPz)./FPz)*100)


plot(FPy) %[output:0934ff94]
hold on %[output:0934ff94]
% plot(Fz_cmd)
plot(Fy_read) %[output:0934ff94]

plot(Fy_read_comp) %[output:0934ff94]
legend('Force plate Fy', 'Motor read Fy', 'Compensated Motor read Fy'); %[output:0934ff94]
title('Horizontal plate vs read') %[output:0934ff94]
hold off %[output:0934ff94]

% percentErrorFy = mean(abs((Fy_read - FPy)./FPy)*100)
% 
% percentErrorFyComp = mean(abs((Fy_read_compensated - FPy)./FPy)*100)

% plot(Fy_read_compensated - FPy)
% hold on
% plot(Fy_read - FPy)
% title('Fz error')
% legend('Compensated Error', 'Uncompensated Error')
% hold off

%%
%[text] ## Sampling plots
t1 = 10000;
t2 = 30000;
linwidth = 1.5;
t = linspace(0, length(FP_tl(t1:t2))/1000, length(FP_tl(t1:t2)));
plot(t, FPz(t1:t2), LineWidth=linwidth, LineStyle='-', Color='#BB5566') %[output:36c28698]
hold on %[output:36c28698]
plot(t, Fz_read_comp(t1:t2), LineWidth=linwidth, LineStyle='--', Color='#004488') %[output:36c28698]
plot(t, Fz_read(t1:t2), LineWidth=linwidth, LineStyle='--', Color='#DDAA33') %[output:36c28698]
legend('Force plate measurement', 'Compensated motor sensed force', 'Uncompensated motor sensed force'); %[output:36c28698]
title('Sample of compensated vertical sensed forces [M2, M3]') %[output:36c28698]
axis([0 20 -inf inf]) %[output:36c28698]

xlabel("Time (s)") %[output:36c28698]
ylabel("Force (N)") %[output:36c28698]
hold off %[output:36c28698]

linwidth = 1.5;
t = linspace(0, length(FP_tr(t1:t2))/1000, length(FP_tr(t1:t2)));
plot(t, FPy(t1:t2), LineWidth=linwidth, LineStyle='-', Color='#BB5566') %[output:90180554]
hold on %[output:90180554]
plot(t, Fy_read_comp(t1:t2), LineWidth=linwidth, LineStyle='--', Color='#004488') %[output:90180554]
plot(t, Fy_read(t1:t2), LineWidth=linwidth, LineStyle='--', Color='#DDAA33') %[output:90180554]
legend('Force plate measurement', 'Compensated motor sensed force','Uncompensated motor sensed force'); %[output:90180554]
title('Sample of compensated horizontal sensed forces [M2, M3]') %[output:90180554]
axis([0 20 -inf inf]) %[output:90180554]
xlabel("Time (s)") %[output:90180554]
ylabel("Force (N)") %[output:90180554]
hold off %[output:90180554]
